import React from 'react';
import StickyVideo from 'react-sticky-video';
import 'react-sticky-video/dist/index.css';

const Video = ({}) => {

  return (
    <div className="video">
      <div className="video-title">What is SPM?</div>
      <div className="video-subheading">See the Video Below</div>
      <div className="video-player">
        <StickyVideo
          url="/media/video-introduction.mp4"
        />
      </div>
    </div>
  )
}

export default Video
